package com.baizhi.entity;import java.util.Date;/** * Created by dell on 2018/6/6. */public class Artical {    private String id;    private String title;    private String insertpic;    private String neirong;    private String teacher_id;    private Date publishtime;    @Override    public String toString() {        return "Artical{" +                "id='" + id + '\'' +                ", title='" + title + '\'' +                ", insertpic='" + insertpic + '\'' +                ", neirong='" + neirong + '\'' +                ", teacher_id='" + teacher_id + '\'' +                ", publishtime=" + publishtime +                '}';    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getInsertpic() {        return insertpic;    }    public void setInsertpic(String insertpic) {        this.insertpic = insertpic;    }    public String getNeirong() {        return neirong;    }    public void setNeirong(String neirong) {        this.neirong = neirong;    }    public String getTeacher_id() {        return teacher_id;    }    public void setTeacher_id(String teacher_id) {        this.teacher_id = teacher_id;    }    public Date getPublishtime() {        return publishtime;    }    public void setPublishtime(Date publishtime) {        this.publishtime = publishtime;    }    public Artical() {    }    public Artical(String id, String title, String insertpic, String neirong, String teacher_id, Date publishtime) {        this.id = id;        this.title = title;        this.insertpic = insertpic;        this.neirong = neirong;        this.teacher_id = teacher_id;        this.publishtime = publishtime;    }}